import PrimarySearchAppBar from "../../component/navbar/Navbar"
import { Box, Typography } from "@mui/material"
import styled from "styled-components"
import "./Homescreen.css"




const SectionFirst=styled(Box)`
  position: relative;
  top: 73px;



`
const BoxFirst = styled(Box)`
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  margin-top: 12px;
  border-bottom: 1px solid #8080807d;
`
const HomeSection=styled(Box)`
  margin-top: 12px;
  height: 100vh;
  width: 100%;
  position: relative;
`


export const HomeScreen = () => {
  return (
    <>
      <PrimarySearchAppBar></PrimarySearchAppBar>
      <SectionFirst>
        <BoxFirst >
          <Box>
            <Typography variant="subtitle1" sx={{fontFamily:"cursive"}} >Mobile</Typography>
          </Box>
          <Box>
            <Typography variant="subtitle1">Electronics</Typography>
          </Box>
          <Box>
            <Typography variant="subtitle1">Fashion</Typography>
          </Box>
          <Box>
            <Typography variant="subtitle1">Furniture</Typography>
          </Box>
        </BoxFirst>
        </SectionFirst>
        <HomeSection>
          <div className="backHomeImg">

          </div>
        </HomeSection>




    </>
  )
}
